import React from 'react'
import fire from '../firebase/config'

const admin = () => {
      const handleLogout = () =>{
            fire.auth().signOut();
      }
      return(
            <div class="app-container">
                  <input style={{background:"#3d7eff", color:"#fff"}} type='button' onClick={handleLogout} value='Log out'/>
            </div>
      );
}

export default admin;
